import React from 'react';


class ProjectSummary extends React.Component{

    render(){
        return(
            <div className='ProjectSummary'>

                <p>Project: {this.props.projectID}</p>
                <p>Project Owner: {this.props.projectOwner}</p>
                <p>Project Title: {this.props.projectTitle}</p>


                <style jsx>
                {`
                    .ProjectSummary {
                        display: flex;
                        flex-direction: row;
                        align-items: center;
                        justify-content: center;

                        height: 2rem;
                        width: 90%;
                        margin-top: 1rem;
                        margin-bottom: 1rem;

                        box-shadow: 3px 3px 3px 3px rgba(15, 75, 10, .4), 
                            -3px -3px 3px 3px rgba(60, 120, 50, .3);
                        border-radius: 3px;
                    }

                    .ProjectSummary:hover {
                        background-color: rgba(15, 75, 10, .4);
                        cursor: pointer;
                        box-shadow: inset 3px 3px 3px 3px rgba(5, 55, 5, .4), 
                            inset -3px -3px 3px 3px rgba(60, 120, 50, .3);
                    }

                    p { 
                        margin-right: 3rem;
                    }
                `}
                </style>
            </div>


        );
    }
}

export default ProjectSummary;
